/*
Build a responsive AJAX-based webpage using HTML, CSS (Tailwind or Bootstrap), and JavaScript.

üéØ Goal:
Implement three features by connecting to the backend APIs hosted at https://hpc.psy.ntu.edu.tw:5000

---

# 1Ô∏è‚É£ Left Panel ‚Äî Live Term Suggestions (/terms)

Create an input field at the top-left corner where the user can type any character (a‚Äìz).
Fetch data from:
  GET https://hpc.psy.ntu.edu.tw:5000/terms
The API returns an array of available terms, like:
[
  "autism spectrum",
  "autobiographical",
  "automatic",
  "autonomic",
  ...
]
While the user types (oninput event), show all terms that start with the typed substring (case-insensitive)
in a scrollable list on the left side of the page. No submit button required ‚Äî results should update automatically.

---

# 2Ô∏è‚É£ Right-Top Panel ‚Äî Related Terms by Jaccard (/terms/<term>)

When a user clicks or selects a term from the left panel,
fetch data from:
  GET https://hpc.psy.ntu.edu.tw:5000/terms/<term>
The API returns JSON like:
{
  "related": [
    { "term": "emotional", "jaccard": 0.2834, "co_count": 726 },
    { "term": "emotion", "jaccard": 0.2357, "co_count": 499 },
    ...
  ]
}
Display the top 10 related terms sorted by Jaccard value (descending) in the top-right section.
Each term should be displayed with its name and Jaccard score.

---

# 3Ô∏è‚É£ Right-Bottom Panel ‚Äî Related Studies (/query/<term>/studies)

After fetching related terms, also query:
  GET https://hpc.psy.ntu.edu.tw:5000/query/<term>/studies
Example:
  https://hpc.psy.ntu.edu.tw:5000/query/amygdala%20not%20emotion/studies

It returns JSON like:
{
  "count": 292,
  "results": [
    {
      "authors": "Buchel C, Dolan RJ, Armony JL, Friston KJ",
      "journal": "The Journal of Neuroscience",
      "title": "Amygdala-hippocampal involvement in human aversive trace conditioning...",
      "year": 1999
    },
    ...
  ]
}
Display the first 10 studies (title, authors, journal, and year) in the bottom-right corner as cards.

---

# üß© Page Layout
Use a two-column responsive layout:
- Left 40% width: search input + dynamic term list
- Right 60% width:
    - Top: related terms (10 items)
    - Bottom: related studies (10 items)

Add minimal styling using Tailwind or Bootstrap for readability.

---

# üí° Additional Requirements
- Use `fetch()` for all AJAX calls.
- Use debounce (300 ms) on input to reduce API calls.
- Handle errors gracefully (show message if fetch fails).
- Display loading indicators while fetching.
- No need for any backend code ‚Äî only front-end HTML + JS.

---
Now, generate `index.html` and `main.js` implementing this full functionality.
*/
Use TailwindCSS for layout and card design. Include real fetch calls to https://hpc.psy.ntu.edu.tw:5000.
