ÈÄôÊòØmain.jsÁöÑÁØÑ‰æã
const API = 'https://hpc.psy.ntu.edu.tw:5000';

const els = {
  input: document.getElementById('termInput'),
  list: document.getElementById('termList'),
  related: document.getElementById('relatedList'),
  studies: document.getElementById('studyList'),
  count: document.getElementById('studyCount'),
};

let allTerms = [];
let debounceTimer = null;

init();

async function init() {
  // 1) ÊäìÂÖ®ÈÉ® terms
  try {
    const r = await fetch(`${API}/terms`);
    allTerms = await r.json(); // ÂõûÂÇ≥ÁÇ∫ array
  } catch (e) {
    console.error(e);
    els.list.innerHTML = `<li>Failed to load /terms</li>`;
  }

  // 2) Á∂ÅËº∏ÂÖ•‰∫ã‰ª∂ÔºàdebounceÔºâ
  els.input.addEventListener('input', () => {
    clearTimeout(debounceTimer);
    debounceTimer = setTimeout(renderFilteredTerms, 300);
  });

  // 3) È¶ñÊ¨°Ê∏≤ÊüìÔºàÁ©∫Â≠ó‰∏≤ÔºùÈ°ØÁ§∫Ââç N Á≠ÜÊàñ‰∏çÈ°ØÁ§∫ÔºåÁúã‰Ω†ÈúÄÊ±ÇÔºâ
  renderFilteredTerms();
}

function renderFilteredTerms() {
  const q = els.input.value.trim().toLowerCase();
  const matches = allTerms
    .filter(t => t.toLowerCase().startsWith(q))
    .slice(0, 200); // ÂÆâÂÖ®‰∏äÈôêÔºåÈÅøÂÖç‰∏ÄÊ¨°Ê∏≤ÊüìÈÅéÂ§ö
  els.list.innerHTML = matches
    .map(t => `<li class="cursor-pointer hover:underline" data-term="${escapeHtml(t)}">${escapeHtml(t)}</li>`)
    .join('') || `<li>No results</li>`;

  // Ë®≠ÈªûÊìä‰∫ã‰ª∂Ôºà‰∫ã‰ª∂ÂßîÊ¥æ‰πüË°åÔºâ
  els.list.querySelectorAll('li[data-term]').forEach(li => {
    li.addEventListener('click', () => onSelectTerm(li.dataset.term));
  });
}

async function onSelectTerm(term) {
  // Âè≥‰∏äÔºörelated terms
  els.related.innerHTML = 'Loading‚Ä¶';
  try {
    const r = await fetch(`${API}/terms/${encodeURIComponent(term)}`);
    const data = await r.json();
    const top10 = (data.related || [])
      .sort((a,b) => b.jaccard - a.jaccard)
      .slice(0, 10);
    els.related.innerHTML = top10.map(x =>
      `<li><span class="font-medium">${escapeHtml(x.term)}</span> ‚Äî jaccard: ${x.jaccard.toFixed(3)}</li>`
    ).join('') || '<li>No related terms</li>';
  } catch (e) {
    els.related.innerHTML = '<li>Failed to load related terms</li>';
  }

  // Âè≥‰∏ãÔºöstudies
  els.studies.innerHTML = 'Loading‚Ä¶';
  els.count.textContent = '';
  try {
    const r = await fetch(`${API}/query/${encodeURIComponent(term)}/studies`);
    const data = await r.json();
    els.count.textContent = data.count ?? '';
    const top10 = (data.results || []).slice(0, 10);
    els.studies.innerHTML = top10.map(s =>
      `<li class="mb-3">
        <div class="font-semibold">${escapeHtml(s.title)}</div>
        <div class="text-sm">${escapeHtml(s.authors)} ¬∑ ${escapeHtml(s.journal)} ¬∑ ${s.year ?? ''}</div>
      </li>`
    ).join('') || '<li>No studies</li>';
  } catch (e) {
    els.studies.innerHTML = '<li>Failed to load studies</li>';
  }
}

function escapeHtml(s) {
  return String(s).replace(/[&<>"']/g, m => ({
    '&':'&amp;','<':'&lt;','>':'&gt;','"':'&quot;',"'":'&#39;'
  }[m]));
}
