  const terms = [];
  let typeArr = [];
  inputs.forEach((input, idx) => {
    let val = input.value.trim();
    if (val) {
      // Á¨¨‰∏ÄÂÄã‰∏ÄÂÆöÊòØ‰∫§ÈõÜ
      if (idx === 0) {
        terms.push(val);
        typeArr.push('plus');
      } else {
        // ‰æùÁÖßÂâçÈù¢spanÂà§Êñ∑
        const sign = input.previousElementSibling?.textContent;
        if (sign === '+') {
          terms.push(val);
          typeArr.push('plus');
        } else if (sign === '-') {
          terms.push(val);
          typeArr.push('minus');
        }
      }
    }
  });
  return { terms, typeArr };
}

function renderFilteredTerms(idx = 0) {
  // ÊîØÊè¥Â§öÊ¨Ñ‰ΩçÔºåÊØèÊ¨°Âè™Ê†πÊìöÁõÆÂâç focus ÁöÑÊ¨Ñ‰ΩçÈ°ØÁ§∫Âª∫Ë≠∞
  const inputs = Array.from(document.querySelectorAll('.termInput'));
  if (!inputs[idx]) return;
  const q = inputs[idx].value.trim().toLowerCase();
  if (!Array.isArray(allTerms)) {
    console.error('allTerms ‰∏çÊòØ array:', allTerms);
    els.termList.innerHTML = `<li class="text-red-500">/terms Â∞öÊú™Ê≠£Á¢∫ËºâÂÖ•</li>`;
    return;
  }
  const matches = allTerms
    .filter(t => typeof t === 'string' && t.toLowerCase().startsWith(q))
    .slice(0, 200);
  els.termList.innerHTML = matches
    .map(t => `<li class="cursor-pointer hover:bg-blue-100 px-2 py-1 rounded" data-term="${escapeHtml(t)}">${escapeHtml(t)}</li>`)
    .join('') || `<li>Êü•ÁÑ°ÁµêÊûú</li>`;

  // Ë®≠ÂÆöÈªûÊìä‰∫ã‰ª∂
  els.termList.querySelectorAll('li[data-term]').forEach(li => {
    li.addEventListener('click', () => {
      // ÈáçË®≠ÊâÄÊúâÊêúÂ∞ãÊ¨Ñ‰ΩçÁÇ∫Âè™Ââ©‰∏ÄÂÄãÔºå‰∏¶Â°´ÂÖ•Ë©≤Ë©û
      els.inputGroup.innerHTML = `
        <div class="flex items-center space-x-2">
          <input type="text" class="termInput px-3 py-2 border rounded focus:outline-none focus:ring w-full" placeholder="Ëº∏ÂÖ•ÈóúÈçµÂ≠ó..." autocomplete="off">
          <button id="addPlus" class="w-8 h-8 flex items-center justify-center bg-green-500 text-white text-lg rounded hover:bg-green-600" title="Êñ∞Â¢û‰∫§ÈõÜÊ¨Ñ‰Ωç">+</button>
          <button id="addMinus" class="w-8 h-8 flex items-center justify-center bg-red-500 text-white text-lg rounded hover:bg-red-600" title="Êñ∞Â¢ûÂ∑ÆÈõÜÊ¨Ñ‰Ωç">-</button>
        </div>
      `;
      // Â°´ÂÖ•ÈªûÈÅ∏ÁöÑË©û
      const firstInput = els.inputGroup.querySelector('.termInput');
      if (firstInput) {
        firstInput.value = li.dataset.term;
        renderFilteredTerms(0);
      }
      // ÈáçÊñ∞Á∂ÅÂÆö‰∫ã‰ª∂
      bindInputEvents();
      document.getElementById('addPlus').addEventListener('click', () => addInput('plus'));
      document.getElementById('addMinus').addEventListener('click', () => addInput('minus'));
      onSelectTerm(li.dataset.term);
    });
  });
}

async function onSelectTerm(term) {
  // Âè≥‰∏äÔºöÁõ∏ÈóúË©ûÂΩô
  showLoadingTable(els.related);
  try {
    const r = await fetch(`${API}/terms/${encodeURIComponent(term)}`);
    const data = await r.json();
    const top10 = (data.related || [])
      .sort((a, b) => b.jaccard - a.jaccard)
      .slice(0, 10);
    els.related.innerHTML = top10.map(x =>
      `<tr>
        <td class="px-3 py-2 border">${escapeHtml(x.term)}</td>
        <td class="px-3 py-2 border text-right">${x.co_count}</td>
        <td class="px-3 py-2 border text-right">${x.jaccard.toFixed(4)}</td>
      </tr>`
    ).join('') || '<tr><td colspan="3" class="text-center text-gray-400">ÁÑ°Áõ∏ÈóúË©ûÂΩô</td></tr>';
  } catch (e) {
    els.related.innerHTML = '<tr><td colspan="3" class="text-red-500">ÁÑ°Ê≥ïËºâÂÖ•Áõ∏ÈóúË©ûÂΩô</td></tr>';
  }

  // Âè≥‰∏ãÔºöÁõ∏ÈóúÁ†îÁ©∂
  showLoading(els.studies);
  els.count.textContent = '';
  try {
    const r = await fetch(`${API}/query/${encodeURIComponent(term)}/studies`);
    const data = await r.json();
    els.count.textContent = data.count ? `ÂÖ± ${data.count} Á≠Ü` : '';
    const top10 = (data.results || []).slice(0, 10);
    els.studies.innerHTML = top10.map(s =>
      `<li class="bg-white shadow rounded p-3">
        <div class="font-semibold mb-1">${escapeHtml(s.title)}</div>
        <div class="text-sm text-gray-700 mb-1">${escapeHtml(s.authors)}</div>
        <div class="text-xs text-gray-500">${escapeHtml(s.journal)}${s.year ? ' ¬∑ ' + s.year : ''}</div>
      </li>`
    ).join('') || '<li>ÁÑ°Áõ∏ÈóúÁ†îÁ©∂</li>';
  } catch (e) {
    els.studies.innerHTML = '<li class="text-red-500">ÁÑ°Ê≥ïËºâÂÖ•Á†îÁ©∂</li>';
  }
}

function showLoading(el) {
  el.innerHTML = '<li class="text-gray-400 animate-pulse">ËºâÂÖ•‰∏≠‚Ä¶</li>';
}
function showLoadingTable(el) {
  el.innerHTML = '<tr><td colspan="3" class="text-gray-400 animate-pulse">ËºâÂÖ•‰∏≠‚Ä¶</td></tr>';
}
function escapeHtml(s) {
  return String(s).replace(/[&<>"']/g, m => ({
    '&':'&amp;','<':'&lt;','>':'&gt;','"':'&quot;','\'':'&#39;'
  }[m]));
}

